description:
Beverly Hills Cop II (1987) 

Verenigde Staten
Actie / Komedie
99 minuten

geregisseerd door Tony Scott
met Eddie Murphy, Judge Reinhold en John Ashton

De agent Axel Foley uit Detroit ziet op het nieuws dat zijn 
vriend, de agent Andrew Bogomil uit Beverly Hills, is neergeschoten 
door een lange vrouw. Hij reist af naar Beverly Hills, waar hij de 
agenten probeert te helpen bij het oplossen van de zaak.
